sys_variable_value.value:
(function execute(inputs, outputs) {
gs.info("HI 1"+inputs.approvalsysid);
gs.info("HI 2"+inputs.approvalstate);
gs.info("HI 3"+inputs.parentsysid);
var approvalSysid = inputs.approvalsysid;
var approvalState = inputs.approvalstate;
var parentSysid = inputs.parentsysid;
new updateApprovalHistroyRecord().updateApprovalHistory(approvalSysid,approvalState,parentSysid);
})(inputs, outputs);

